    let timelineIndex = {};
    let polylines = {};
    let timeline_running = false;
    let intervalId = null;

    // Initialize indices for each truck
    timelineIndex['TRUCK 0'] = 0

    function drawTimelineSegment(truck) {
        if (!pathsByTruck[truck] || timelineIndex[truck] >= pathsByTruck[truck].length - 1) return false;

        const segment = [pathsByTruck[truck][timelineIndex[truck]], pathsByTruck[truck][timelineIndex[truck] + 1]];
        if (!polylines[truck]) {
            const truckColors = {'TRUCK 0': 'cyan', 'TRUCK 2': 'lime', 'TRUCK 3': 'red', 'TRUCK 4': 'yellow', 'UNKNOWN TRUCK': 'white'};
            const color = truckColors[truck] || 'white';
            polylines[truck] = L.polyline(segment, {color: color, weight: 5}).addTo(map);
        } else {
            polylines[truck].addLatLng(pathsByTruck[truck][timelineIndex[truck] + 1]);
        }
        timelineIndex[truck]++;
        return true;
    }

    function resetTimeline() {
        for (const truck in polylines) {
            if (polylines[truck]) {
                map.removeLayer(polylines[truck]);
                polylines[truck] = null;
            }
            timelineIndex[truck] = 0;
        }
        if (intervalId) {
            clearInterval(intervalId);
            intervalId = null;
        }
        timeline_running = false;
        document.getElementById('timeline-btn').innerText = "‚ñ∂Ô∏è Play Timeline";
    }

    function playTimeline(interval = 800) {
        if (timeline_running) {
            resetTimeline();
            return;
        }

        timeline_running = true;
        document.getElementById('timeline-btn').innerText = "‚èπÔ∏è Stop Timeline";

        for (const truck in polylines) {
            if (polylines[truck]) {
                map.removeLayer(polylines[truck]);
                polylines[truck] = null;
            }
            timelineIndex[truck] = 0;
        }

        intervalId = setInterval(() => {
            let anyActive = false;
            for (const truck in pathsByTruck) {
                const active = drawTimelineSegment(truck);
                anyActive = anyActive || active;
            }

            if (!anyActive) {
                clearInterval(intervalId);
                intervalId = null;
                timeline_running = false;
                document.getElementById('timeline-btn').innerText = "‚ñ∂Ô∏è Play Timeline";
            }
        }, interval);
    }
